import React from "react";
import "../App.css";

const ContactUs = () => {
  return (
    <>
      <div style={{ height: "1000vh" }}>
        <img
          className="HomeLogo"
          src={require("./몰입캠프_검정.png").default}
          style={{}}
        />
      </div>
    </>
  );
};

export default ContactUs;
